// contracts/VotingContract.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/access/Ownable.sol";

contract VotingContract is Ownable {

    struct Party {
        uint id;
        string name;
        string abbreviation;
    }

    struct VoterInfo {
        bool hasVoted;
        uint voteTimestamp;
    }

    Party[] public parties;
    uint public nextPartyId = 1;

    mapping(bytes32 => VoterInfo) public voters;
    mapping(uint => uint) public partyVotes;

    event VoteCast(bytes32 indexed voterIdentifierHash, uint indexed partyId, uint timestamp);
    event PartyAdded(uint indexed partyId, string name, string abbreviation);

    constructor() Ownable(msg.sender) {
        _addParty("Bharatiya Janata Party", "BJP");
        _addParty("Indian National Congress", "INC");
        _addParty("Aam Aadmi Party", "AAP");
        _addParty("Bahujan Samaj Party", "BSP");
        _addParty("Communist Party of India (Marxist)", "CPI(M)");
        _addParty("National People's Party", "NPP");
    }

    function addParty(string memory _name, string memory _abbreviation) public onlyOwner {
       _addParty(_name, _abbreviation);
    }

    function _addParty(string memory _name, string memory _abbreviation) internal {
         require(bytes(_name).length > 0, "Party name cannot be empty");
         require(bytes(_abbreviation).length > 0, "Party abbreviation cannot be empty");
         parties.push(Party({ id: nextPartyId, name: _name, abbreviation: _abbreviation }));
         emit PartyAdded(nextPartyId, _name, _abbreviation);
         nextPartyId++;
    }

    function castVote(bytes32 _voterIdentifierHash, uint _partyId) public {
        require(_partyId > 0 && _partyId < nextPartyId, "Invalid party ID");
        require(!voters[_voterIdentifierHash].hasVoted, "Voter has already cast a vote");
        voters[_voterIdentifierHash].hasVoted = true;
        voters[_voterIdentifierHash].voteTimestamp = block.timestamp;
        partyVotes[_partyId]++;
        emit VoteCast(_voterIdentifierHash, _partyId, block.timestamp);
    }

    function getPartyCount() public view returns (uint) { return parties.length; }
    function getParty(uint _partyId) public view returns (uint id, string memory name, string memory abbreviation) {
         require(_partyId > 0 && _partyId <= parties.length, "Invalid party ID provided");
         Party storage p = parties[_partyId - 1];
         return (p.id, p.name, p.abbreviation);
    }
    function getAllParties() public view returns (Party[] memory) { return parties; }
    function getVoteCount(uint _partyId) public view returns (uint) {
         require(_partyId > 0 && _partyId < nextPartyId, "Invalid party ID");
         return partyVotes[_partyId];
    }
    function hasVoted(bytes32 _voterIdentifierHash) public view returns (bool) { return voters[_voterIdentifierHash].hasVoted; }
}
